import Video from "../video/Video";

const ModalApp = () => {
  function cerrar() {
    return null;
  }
  return (
    <div className="overlay">
      <div className="popup">
        <i class="far fa-times-circle" onClick={cerrar}></i>
        <Video />
      </div>
    </div>
  );
};
export default ModalApp;
